import React from "react";
import {
  FaHtml5,
  FaReact,
  FaJava,
  FaPython,
  FaNode,
  FaCss3,
  FaGit,
} from "react-icons/fa";
import { MdJavascript, MdCode } from "react-icons/md";
import {
  BiLogoFlutter,
  BiLogoTailwindCss,
  BiLogoMongodb,
} from "react-icons/bi";
import Skill from "./Skill";
function Skills() {
  const ICON_SIZE = 100;
  const skills = [
    {
      icon: <FaHtml5 />,
      name: "HTML5",
    },
    {
      icon: FaGit,
      name: "Git",
    },
    {
      icon: FaJava,
      name: "Java",
    },
    {
      icon: FaPython,
      name: "Python",
    },
    {
      icon: FaReact,
      name: "React",
    },
    {
      icon: BiLogoTailwindCss,
      name: "Tailwind CSS",
    },
    {
      icon: FaNode,
      name: "Node.js",
    },
    {
      icon: FaCss3,
      name: "CSS3",
    },
    {
      icon: BiLogoFlutter,
      name: "Flutter",
    },
    {
      icon: MdJavascript,
      name: "JavaScript",
    },
    {
      icon: MdCode,
      name: "Code",
    },
    {
      icon: BiLogoMongodb,
      name: "MongoDB",
    },
  ];

  return (
    <section id="skills" name="skills" className="flex flex-col px-40 pt-20">
      <h1 className="text-5xl font-medium">Skills</h1>
      <div className="grid  gap-y-28 grid-cols-4 mt-20 justify-items-center mb-20">
        {skills.map((skill) => {
          return <Skill icon={skill.icon} name={skill.name} />;
        })}
      </div>
    </section>
  );
}

export default Skills;
